answers.text:
@shervonnnnn yes I do agree. I didn’t say our rates are Low in terms of death or positive tests. In comparison to our population, they might be more compared to other big counties with 1000+ deaths.

My point is Singapore’s positive results are increasing and that doesn’t necessarily means we are in a bad situation vs others. Our government is just actively testing all the migrant workers and thus we have more cases than countries who are not testing at all or testing as much. 
Hope it’s clear 😀
